        [Fact]
        public void Validate_GivenAllPropertiesAreValid_ExpectValidationSuccess()
        {
            var cmd = new AuthenticatorApp.Model { SharedKey = new string('*', 6), Code = new string('*', 7) };
            var validator = new AuthenticatorApp.Validator();
            var result = validator.Validate(cmd);
            Assert.True(result.IsValid);
        }

        [Fact]
        public void Validate_GivenCodeIsEmpty_ExpectValidationFailure()
        {
            var cmd = new AuthenticatorApp.Model { SharedKey = new string('*', 7), Code = string.Empty };
            var validator = new AuthenticatorApp.Validator();
            var result = validator.Validate(cmd);
            Assert.False(result.IsValid);
            Assert.Contains(
                result.Errors,
                failure => failure.PropertyName == "Code");
        }

