        [Fact]
        public async Task OnPostRevokeAsync_GivenCommandExecutes_ExpectSuccessfulPrgStateAndRedirectToPageResultReturn()
        {
            var userQueries = new Mock<IUserQueries>();
            var mediator = new Mock<IMediator>();
            mediator.Setup(x => x.Send(It.IsAny<RevokeAuthenticatorAppCommand>(), It.IsAny<CancellationToken>()))
                .ReturnsAsync(ResultWithError.Ok<ErrorData>);
            var urlEncoder = new Mock<UrlEncoder>();
            var securitySettings = new Mock<IOptions<SecuritySettings>>();
            var currentAuthenticatedUserProvider = new Mock<ICurrentAuthenticatedUserProvider>();

            var page = new AuthenticatorApp(userQueries.Object, mediator.Object, urlEncoder.Object, securitySettings.Object, currentAuthenticatedUserProvider.Object);

            var result = await page.OnPostRevokeAsync();

            Assert.IsType<RedirectToPageResult>(result);
            Assert.Equal(PrgState.Success, page.PrgState);
        }

