        [Fact]
        public async Task OnGetAsync_GivenNoUserAppearsToBeAuthenticate_ExpectErroredPrgState()
        {
            var userQueries = new Mock<IUserQueries>();
            var mediator = new Mock<IMediator>();
            var urlEncoder = new Mock<UrlEncoder>();
            var securitySettings = new Mock<IOptions<SecuritySettings>>();
            var currentAuthenticatedUserProvider = new Mock<ICurrentAuthenticatedUserProvider>();
            currentAuthenticatedUserProvider.Setup(x => x.CurrentAuthenticatedUser)
                .Returns(Maybe<ISystemUser>.Nothing);

            var page = new AuthenticatorApp(userQueries.Object, mediator.Object, urlEncoder.Object,
                securitySettings.Object, currentAuthenticatedUserProvider.Object);

            await page.OnGetAsync();

            Assert.Equal(PrgState.InError, page.PrgState);
        }

        [Fact]
        public async Task OnGetAsync_GivenUserHasAnAppEnrolled_ExpectSetupToBeTrue()
        {
            var userQueries = new Mock<IUserQueries>();
            userQueries.Setup(x => x.CheckForPresenceOfAuthAppForCurrentUser())
                .ReturnsAsync(
                    () => new StatusCheckModel(true));
            var mediator = new Mock<IMediator>();
            var urlEncoder = new Mock<UrlEncoder>();
            var securitySettings = new Mock<IOptions<SecuritySettings>>();
            var currentAuthenticatedUserProvider = new Mock<ICurrentAuthenticatedUserProvider>();
            currentAuthenticatedUserProvider.Setup(x => x.CurrentAuthenticatedUser)
                .Returns(() =>
                {
                    ISystemUser user = new AuthenticatedUser(Guid.NewGuid(), "email-address", "first-name", "last-name");
                    return Maybe.From(user);
                });

            var page = new AuthenticatorApp(userQueries.Object, mediator.Object, urlEncoder.Object,
                securitySettings.Object, currentAuthenticatedUserProvider.Object);

            await page.OnGetAsync();

            Assert.True(page.IsSetup);
        }

        [Fact]
        public async Task OnGetAsync_GivenUserHasNoAppEnrolledAndPageModelIsNull_ExpectPageDetailsFromCommand()
        {
            var userQueries = new Mock<IUserQueries>();
            userQueries.Setup(x => x.CheckForPresenceOfAuthAppForCurrentUser())
                .ReturnsAsync(
                    () => new StatusCheckModel(false));

            var mediator = new Mock<IMediator>();
            mediator.Setup(x => x.Send(It.IsAny<InitiateAuthenticatorAppEnrollmentCommand>(), CancellationToken.None))
                .ReturnsAsync(() =>
                    Result.Ok<InitiateAuthenticatorAppEnrollmentCommandResult, ErrorData>(
                        new InitiateAuthenticatorAppEnrollmentCommandResult("some-key")));
            var urlEncoder = new Mock<UrlEncoder>();
            var securitySettings = new Mock<IOptions<SecuritySettings>>();
            securitySettings.Setup(x => x.Value).Returns(new SecuritySettings
            {
                SiteName = "site-name",
            });
            var currentAuthenticatedUserProvider = new Mock<ICurrentAuthenticatedUserProvider>();
            currentAuthenticatedUserProvider.Setup(x => x.CurrentAuthenticatedUser)
                .Returns(() =>
                {
                    ISystemUser user = new AuthenticatedUser(Guid.NewGuid(), "email-address", "first-name", "last-name");
                    return Maybe.From(user);
                });

            var page = new AuthenticatorApp(userQueries.Object, mediator.Object, urlEncoder.Object,
                securitySettings.Object, currentAuthenticatedUserProvider.Object);

            await page.OnGetAsync();

            Assert.False(page.IsSetup);

            Assert.Equal("some -key", page.SharedKey);
            Assert.Equal("otpauth://totp/:?secret=some-key&issuer=&digits=6", page.AuthenticatorUri);
            Assert.Equal("", page.Code);
        }

